import React from 'react';




export class Review extends React.Component{

    constructor(props){
        super(props)
        this.state = {

        }

    }


    render(){
        return(
            <div>
                <p>{this.props.course}</p>
                <p>{this.props.student}</p>
                <p>{this.props.professor}</p>
                <p>{this.props.review}</p>

            </div>
            
        )
    }


}




export class Reviewer extends React.Component{
    constructor(){
        super()
        this.state = {
            comp : null,
            comp2: null

        }

    }

    operation(){
        
        this.setState({
            comp: <Review student = "john" course = "Psychology" professor = "Mr. Larry" review = "easy class with no homework"/>,
            comp2: <Review student = "Mary" course = "Philosophy" professor = "Mr. Drew" review = "hard class with many exams"/>
        })

    }


    render(){
        return(
            <div>
                <form>
                    <input type = 'text' placeholder = "Student Name"></input>
                    
                    <input type = 'text' placeholder = "Professor Name"></input>

                    <input type = 'text' placeholder = "Course Name"></input>
                    
                    <input type = 'text' placeholder = "Course Review"></input>

                    <button type = 'submit' onClick = {() => this.operation()}>Submit</button>
                </form>

                <p>{this.state.comp}</p>
                <p>{this.state.comp2}</p>



            </div>
            
        )
    }


}


export class Test extends React.Component{
    render(){
        const student = "john"
        const course = "Psychology"
        const professor = "Mr. Larry"
        const review = "Cool class, lots to learn"

        return(
            <div>
                <Tester student = {student} course = {course} professor = {professor} review = {review} />

            </div>
        )
    }
}




export class Tester extends React.Component{
    render(){
        return(
            <div>
                <p>{this.props.student}</p>
                <p>{this.props.course}</p>
                <p>{this.props.professor}</p>
                <p>{this.props.review}</p>
                
            </div>
        )
    }
}




export class GiveReview extends React.Component{
    constructor(){
        super()
        this.state = {


        }

    }

    operation(){
        
        this.setState({
            comp: <Review student = "john" course = "Psychology" professor = "Mr. Larry" review = "easy class with no homework"/>,
            comp2: <Review student = "Mary" course = "Philosophy" professor = "Mr. Drew" review = "hard class with many exams"/>
        })

    }


    render(){
        return(
            <div>
                <form>
                    <input type = 'text' placeholder = "Student Name"></input>
                    
                    <input type = 'text' placeholder = "Professor Name"></input>

                    <input type = 'text' placeholder = "Course Name"></input>
                    
                    <input type = 'text' placeholder = "Course Review"></input>

                    <button type = 'submit' onClick = {() => this.operation()}>Submit</button>
                </form>

                <p>{this.state.comp}</p>
                <p>{this.state.comp2}</p>



            </div>
            
        )
    }


}
